import axios from 'axios';


export default function idCheck(id, callback) {
    axios(
        {
            url: '/member/select',
            method: 'get',
            data:{'id':id},
            baseURL: 'http://localhost:8888',
            withCredentials: true,
        }
    ).then(function() {
          
    });
}
